To create a module, you have to call this function: module_t* luos_module_create(void* callback, module_type_t type, char* default_alias); The returned module_t* is a module structure pointer that will be useful to make your module act in the network after this initialization. callback is a pointer to a callback function called by Luos when your module receive messages from other modules (see Real-time configuration page for more details). This function needs to have a specific format: void module_cb(module_t *module, msg_t *msg) module is the module pointer of the module receiving the data (basically, it's your module). msg is the message your module received. type is the type of the your new module represented by a number. Some basic types (e.g. DISTANCE_MOD, VOLTAGE_MOD, etc.) are already available in the module_type_t enum structure of Luos. You can also create your own on top of the luos one. default alias is the alias by default for your new module. e.g. MyModule02. This alias is the one your module will take if no other alias is set by the user of your functionality hosted in your module. Aliases have a maximum size of 16 characters. Following the project rules , here is a code example for a button module: module_t* module_btn; void rx_btn_cb(module_t *module, msg_t *msg){ // Manage received messages
