Before starting using streaming method, you have to create a streaming channel linked to a buffer into the init function of your real-time module: #define BUFFER_SIZE 1024
volatile angular_position_t trajectory_ring_buf[BUFFER_SIZE];
streaming_channel_t trajectory; void motor_init(void) { trajectory = create_streaming_channel(trajectory_ring_buf, BUFFER_SIZE, sizeof(angular_position_t)); luos_module_create(rx_mot_cb, CONTROLLED_MOTOR_MOD, "motor_mod");
} Now you can use this channel to receive or transmit a streaming flux: reception is adapted to make our motor move smoothly. A no-real-time module will send us parts of trajectory approximately each second and our motor will consume angular position at 200Hz. transmission is adapted to measure precisely the movements of the motor. We can use it to send in a no-real-time way real-time data. In our motor it could be angular position measurement at 200Hz for example.

