When the JSON routing table is transmitted, the Gate starts to update and stream your network data with modules information . This JSON is a "module" object listing all the modules by their alias and the values they send: { "modules":{ "module_alias1":{ "value1":12.5 }, "module_alias2":{ "value1":13.6, "value2":[1, 2, 3, 4] } }
} You can use the exact same JSON object structure to send data to modules. Here is the list of all values that can be used by modules: Value name Definition power_ratio Percentage of power of an actuator (-100% to 100%) target_rot_position Actuator's target angular position (can be a number or an array) limit_rot_position Actuator's limit angular position limit_trans_position Actuator's limit angular position limit_power Limit ratio of an actuator's reduction limit_current Limit current value target_rot_speed Actuator's target rotation speed target_trans_position Actuator's target linear position (can be a number or an array) target_trans_speed Actuator's target linear speed time Time value compliant Actuator's compliance status pid Set of PID values (proportionnal, integral, derivative) resolution Sensor's resolution value offset Offset value reduction Ratio of an actuator's reduction dimension Dimension value volt Voltage value current Electric current value reinit Reinitialisation command control Control command (play, pause, stop, rec) color Color value io_state IO state led Board's LED node_temperature Node's temperature node_voltage Node's voltage uuid Module's uuid rename Renaming an alias revision Firmware revision trans_position Translation position value trans_speed Translation speed value rot_position Rotation position value rot_speed Rotation speed value lux Lux (light intensity) value temperature Temperature value force Force value moment Torque value power Power value linear_accel Linear acceleration value gravity_vector Gravity vector value compass Compass value gyro Gyroscope value accel Acceleration value euler Euler angle value quaternion Quaternion values rotational_matrix Rotational matrix values heading Heading pedometer Steps number value walk_time Walk time value luos_revision luos's version robus_revision robus's version Here is an exemple of a message sent by a Potentiometer module about the rotation angle of the associated potentiometer: { "modules":{ "potentiometer_m":{ "rot_position":12.5 } }
} Specific messages Some messages are specifically handled: For Dynamixel and void modules: Object Definition register Motor memory register filed with [register_number, value] set_id A set id command wheel_mode The wheel mode parameter for Dynamixel servomotors True or False For Stepper , Controlled-motor and Servo modules: Object Definition parameters enabling or disabling some measurement For Imu module: Object Definition parameters enabling or disabling some measurement For Gate module: Object Definition delay reduce modules refresh rate
